import React, {Suspense, useEffect} from 'react';
import './apiStatus.css';
import '../index.css'

function Apistatus() {

    useEffect(() => { 

    })
  
    return (
    <>
        <div className="api-status ui outer container p-20">

            <p>
            <span className='api-status t-center'><b>API STATUS</b><pre class='pre-inline'> API Has not been activated yet.</pre></span>
            </p>

            <div class="api-status btn-wrap">
                <button class="api-status btn stop" id="force-stop">
                stop searching
                </button>
                <button class="api-status btn start" id="search-data">
                start searching
                </button>
            </div>

        </div>
    </>
    );
  }

  export {Apistatus}
